import React from 'react';

import { Jumbotron } from 'react-bootstrap';

export default props => {
    return(
        <div>
        <Jumbotron>
            <h1>Lichelle Gaerlan</h1>
            <h2>designer / developer / network specialist</h2>

            <p>
                If you would like to get in touch or work on a project together,
                feel free to contact me at
                lichellemaegaerlan@gmail.com or at (702) 302-2920
            </p>

            <p>
                Github / LinkedIn / Mail / Phone
            </p>
        </Jumbotron>
        </div>
    );
}
